const dataServices = [

    {
        img: img1,
        title: 'SABER MÁS',
        url:'/service-landing'
    },
    {
        img: img2,
        title: 'SABER MÁS',
        url:'/service-web'
    },
    {
        img: img3,
        title: 'SABER MÁS',
        url:'/service-ecommerce'
    },

]

export default dataServices;
